import React from 'react';

function NavBar() {
  return (
    <div className="nav">
      <p className='logo'>IDEALISTA</p>
      <ul>
        <li>Contact</li>
        <Link to='/listings'><li>Listings</li></Link>
        <li>About</li>
      </ul>
    </div>
  );
}

export default NavBar;
